package blockchain.test;

public class IsEqual {
	public void isEqual(String str1, String str2) {
		if(str1.equals(str2)) {
			System.out.println("일치");
		} else {
			System.out.println("불일치");
		}
		
	}
	public static void main(String[] args) {
		IsEqual ie = new IsEqual();
		ie.isEqual(""
				,  "");
		ie.isEqual(""
				,  "");
	}
}
